// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AIMarketplace {
    struct Model {
        string name;
        string description;
        uint256 price; // Price in Wei
        address payable creator; // Address of the model creator
        uint8 ratingCount; // Total number of ratings
        uint256 totalRating; // Sum of ratings for average calculation
    }

    Model[] public models; // Array to store all models
    mapping(uint256 => mapping(address => bool)) public ratings; // Mapping to track if an address has rated a model
    address public owner; // Owner of the contract

    event ModelListed(uint256 modelId, string name, uint256 price, address creator);
    event ModelPurchased(uint256 modelId, address buyer);
    event ModelRated(uint256 modelId, uint8 rating, address rater);

    constructor() {
        owner = msg.sender; // Set the contract deployer as the owner
    }

    // Function to list a new AI model
    function listModel(string memory name, string memory description, uint256 price) public {
        models.push(Model({
            name: name,
            description: description,
            price: price,
            creator: payable(msg.sender),
            ratingCount: 0,
            totalRating: 0
        }));
        
        emit ModelListed(models.length - 1, name, price, msg.sender);
    }

    // Function to purchase an AI model
    function purchaseModel(uint256 modelId) public payable {
        require(modelId < models.length, "Model does not exist.");
        require(msg.value == models[modelId].price, "Incorrect value sent.");

        models[modelId].creator.transfer(msg.value); // Transfer payment to the model creator
        
        emit ModelPurchased(modelId, msg.sender);
    }

    // Function to rate a purchased AI model
    function rateModel(uint256 modelId, uint8 rating) public {
        require(modelId < models.length, "Model does not exist.");
        require(!ratings[modelId][msg.sender], "You have already rated this model.");
        require(rating > 0 && rating <= 5, "Rating must be between 1 and 5.");

        ratings[modelId][msg.sender] = true; // Mark that this user has rated the model

        models[modelId].ratingCount++;
        models[modelId].totalRating += rating;

        emit ModelRated(modelId, rating, msg.sender);
    }

    // Function to withdraw accumulated funds by the owner
    function withdrawFunds() public {
        require(msg.sender == owner, "Only the owner can withdraw funds.");
        
        payable(owner).transfer(address(this).balance); // Transfer all balance to the owner
    }

    // Function to get details of a specific AI model
    function getModelDetails(uint256 modelId) public view returns (string memory name, string memory description, uint256 price, address creator, uint8 averageRating) {
        require(modelId < models.length, "Model does not exist.");
        
        Model memory model = models[modelId];
        
        averageRating = model.ratingCount > 0 ? uint8(model.totalRating / model.ratingCount) : 0;

        return (model.name, model.description, model.price, model.creator, averageRating);
    }
}
